import React, { useState } from "react";

const App = () => {
  const [nombre, setNombre] = useState("Fernando Mauricio Castillo Rosales");
  const [contrasena, setContrasena] = useState("");
  const [departamento, setDepartamento] = useState("");

  const handleNombreChange = (e) => {
    setNombre(e.target.value);
  };

  const handleContrasenaChange = (e) => {
    setContrasena(e.target.value);
  };

  const handleDepartamentoChange = (e) => {
    setDepartamento(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    alert("Formulario enviado");
  };

  return (
    <div className="container mx-auto">
      {/* Navbar */}
      <nav className="bg-gray-800 p-4 flex justify-between items-center">
        <div className="text-white font-bold">Inicio</div>
        <div className="flex space-x-4">
          <div className="text-white">Perfil</div>
          <div className="text-white">Registro de Departamentos</div>
          <div className="text-white">Administración de Tickets</div>
        </div>
      </nav>

      <div className="flex flex-col items-center justify-center h-screen">
        <div className="w-full max-w-md">
          <div className="bg-white shadow-md rounded-md p-6">
            <h1 className="text-center text-2xl font-bold mb-4">
              Perfil de Usuario
            </h1>
            <form onSubmit={handleSubmit}>
              <div className="mb-4">
                <label
                  htmlFor="nombre"
                  className="block text-gray-700 text-sm font-bold mb-2"
                >
                  Nombre
                </label>
                <input
                  type="text"
                  id="nombre"
                  className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                  value={nombre}
                  onChange={handleNombreChange}
                />
              </div>
              <div className="mb-4">
                <label
                  htmlFor="contrasena"
                  className="block text-gray-700 text-sm font-bold mb-2"
                >
                  Contraseña
                </label>
                <input
                  type="password"
                  id="contrasena"
                  className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                  value={contrasena}
                  onChange={handleContrasenaChange}
                />
              </div>
              <div className="mb-4">
                <label
                  htmlFor="departamento"
                  className="block text-gray-700 text-sm font-bold mb-2"
                >
                  Departamento
                </label>
                <select
                  id="departamento"
                  className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                  value={departamento}
                  onChange={handleDepartamentoChange}
                >
                  <option value="">Seleccione un departamento</option>
                  <option value="Ventas">Ventas</option>
                  <option value="Marketing">Marketing</option>
                  <option value="Desarrollo">Desarrollo</option>
                </select>
              </div>
              <div className="flex items-center justify-center">
                <button
                  type="submit"
                  className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
                >
                  Editar
                </button>
              </div>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
};

export default App;
